enum GrammarSymbol {
  NOT_EQUALS = 0,
  LEFT_PARAN = 1,
  RIGHT_PARAN = 2,
  STAR = 3,
  PLUS = 4,
  MINUS = 5,
  DIV = 6,
  SEMICOLON = 7,
  LESS_THAN = 8,
  LESS_EQUALS = 9,
  EQUALS = 10,
  GREATER_THAN = 11,
  GREATER_EQUALS = 12,
  AND = 13,
  CONJUNCTION = 14,
  DISJUNCTION = 15,
  ENDOFFILE = 16,
  EXPR = 17,
  FACTOR = 18,
  FALSE = 19,
  FLOAT = 20,
  INTEGER = 21,
  NEGATION = 22,
  NOT = 23,
  OR = 24,
  PROGRAM = 25,
  RELATION = 26,
  STMT = 27,
  STMTS = 28,
  SUM = 29,
  TERM = 30,
  TRUE = 31
};

std::string to_string(GrammarSymbol symbol);

enum StateTransitionType {
  SHIFT,
  GOTO,
  REDUCE,
  ACCEPT,
  ERROR
};

std::string to_string(StateTransitionType transition);

struct StateTransition {
  StateTransitionType type = StateTransitionType::ERROR;
  int nextStateIndex = 0;
  GrammarSymbol symbol = ENDOFFILE;
  std::vector<GrammarSymbol> rule = {};
};

std::string to_string(StateTransition &action);

